const express = require("express");
const app = express();
const mysql = require("mysql");
const cors = require("cors");
const PORT = 3001;

const { encrypt, decrypt } = require("./components/EncryptionHandler");

app.use(cors());
app.use(express.json());


app.listen(3001, () => {
  console.log("Server is running");
});
